import React, {Component} from 'react';

class bookpage extends Component {

    constructor(props){
        super(props)
        this.state ={
            name: null
        }
    }

    handleSubmit=(event)=>{
        event.preventDefault()

    }
    handleInputChange=(event)=>{
        event.preventDefault()
        console.log(event)
        console.log(event.target.name)
        console.log(event.target.value)
        this.setState({
            [event.target.name]: event.target.value
        })
    }
    render() {
        const {name}=this.state
    return (
        <div className="container">
            <div className="py-4">
                <h1>name is: {name}</h1>
            <form onSubmit={this.handleSubmit}>
            <div class="form-group row">
    <label for="colFormLabelLg" class="col-sm-2 col-form-label col-form-label-lg">Name</label>
    <div class="col-sm-10">
      <input  type="text" placeholder="Ex:Jhon" name="name"/>
    </div>
  </div>
  <div class="form-group row">
    <label for="colFormLabelLg" class="col-sm-2 col-form-label col-form-label-lg">Mobile</label>
    <div class="col-sm-10">
      <input type="text" placeholder="Ex:9917004183" name="mobile"/>
    </div>
  </div>
  <div class="form-group row">
    <label for="colFormLabelLg" class="col-sm-2 col-form-label col-form-label-lg">Email</label>
    <div class="col-sm-10">
      <input type="email" placeholder="ex@example.com" name="email"/>
    </div>
  </div>
  <br></br>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>

            </div>
        </div>
    );
    }
};

export default bookpage;
